remarks:
Tones for the Prefaces (1. Solemn Tone)

Hic tonus adhibetur :
a) in dominicis;
b) in Missis festivis et in Missa de Officio S. Mariæ in sabbato;
c) in vigiliis Nativitatis Domini et Pentecostes;
d) feria V. in Cena Domini et in Missa Vigiliæ paschalis;
e) per octavas;
f) in Missis votivis I., II. et III. classis.

Tones for the Prefaces (2. Ferial Tone)

Hic tonus adhibetur :
a) in Commemorationibus;
b) in feriis;
c) in vigiliis II. et III. classis;
d) in Missis votivis IV. classis;
e) in Missis defunctorum.

